import React from 'react'
import './home.css'

export  function HomePage() {
  return (
    <div>
      <div style={{
        display:'flex'
      }}>

        <div style={{ display:'flex', backgroundColor:'white'}}>
            <div style={{
                width:272,
                height:142,
            }}><img src='images/icons/BlvckLogo.png' style={{
                width:"100%",
                height:"100%",
                position:'relative',
            }}/>
            </div>
            <div style={{
                width: 270,
                height: 61,
                // left: 116px;
                // top: 63px;
                
                fontFamily: 'Poppins',
                fontStyle: 'normal',
                fontWeight: 600,
                fontSize: 24,
                lineHeight: 36,
                display: 'flex',
                alignItems: 'center',
                textAlign: 'center',
                letterSpacing: "0.27em",
                
                color: "#FF003D",
                
            }}
            >LVCK CODA</div>
        </div>
        <div>
            <p>
                DANIEL
                <br/>
                EWURUM
            </p>
        </div>
      </div>
    </div>
  )
}
